#

DROP TABLE IF EXISTS `bidi_roller_entry`;

CREATE TABLE `bidi_roller_entry` (
  `bidi_roller_entry_id` int(20) NOT NULL AUTO_INCREMENT,
  `UAN` bigint(20) NOT NULL,
  `member_name` varchar(100) NOT NULL,
  `gross_wages` bigint(10) NOT NULL,
  `epf_wages` bigint(10) NOT NULL,
  `eps_wages` bigint(10) NOT NULL,
  `edli_wages` bigint(10) NOT NULL,
  `epf_contri_remitted` bigint(10) NOT NULL,
  `eps_contri_remitted` bigint(10) NOT NULL,
  `epf_eps_diff_remitted` bigint(10) NOT NULL,
